def predict(triples: list[Triple]) -> str:
    """
    Converts a list of triples into a natural language sentence.
    """
    sentence = ""
    subject = ""
    for i, triple in enumerate(triples):
        if i == 0:
            subject = triple.subject
            sentence += f"{subject} "
            if triple.predicate == "city":
                sentence += f"is a city in {triple.object} "
            elif triple.predicate == "country":
                sentence += f"is located in {triple.object} "
            elif triple.predicate == "established":
                sentence += f"was established in {triple.object} "
            elif triple.predicate == "numberOfStudents":
                sentence += f"has {triple.object} students "
            elif triple.predicate == "academicStaffSize":
                sentence += f"has an academic staff of {triple.object} "
        else:
            if triple.predicate == "city":
                sentence += f"which is in {triple.object} "
            elif triple.predicate == "country":
                sentence += f", which is located in {triple.object} "
            elif triple.predicate == "established":
                sentence += f"and was established in {triple.object} "
            elif triple.predicate == "numberOfStudents":
                sentence += f"with {triple.object} students "
            elif triple.predicate == "academicStaffSize":
                sentence += f"and has an academic staff of {triple.object} "
            else:
                sentence += f"and has a {triple.predicate} of {triple.object} "
    return sentence

